import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div className="flex-row-align disperse pad-2 | wide-font">
        <div className="flex-row">
          <div></div>
          <div>Portal</div>
        </div>
        <div className="flex-row-align">
          <div>About</div>
          <div className="box pad-05">Save</div>
        </div>
      </div>
    );
  }
}

export default Header;
